import React, { Component } from "react";
class gate extends Component {
  //static async getInitialProps() {}
  render() {
    return (
      <>
        {console.log(this.props)}
        <div className="header">
          <form>
            <div className="search-items">
              <p>
                Select the range of dates to view summary Maximum of 30 days
              </p>

              <div>
                From:
                <input name="datepicker1" type="date" />
                To:
                <input name="datepicker2" type="date" />
                <input name="load" type="button" value="Load" />
              </div>
            </div>
          </form>
        </div>

        <div className="main">
          <div className="card">
            <div className="card-title">Gate 1</div>
            <div className="card-body">
              <table>
                <thead>
                  <tr>
                    <th>S/N</th>
                    <th>Item Name</th>
                    <th>Fee</th>
                    <th>Quantity</th>
                    <th>Amount</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>1</td>
                    <td>Keke Napep</td>
                    <td>20</td>
                    <td>100</td>
                    <td>2000</td>
                  </tr>
                  <tr>
                    <td>1</td>
                    <td>Cars</td>
                    <td>20</td>
                    <td>100</td>
                    <td>2000</td>
                  </tr>
                  <tr>
                    <td>1</td>
                    <td>Truck/Lorry</td>
                    <td>20</td>
                    <td>100</td>
                    <td>2000</td>
                  </tr>
                  <tr>
                    <td>1</td>
                    <td>Canter</td>
                    <td>20</td>
                    <td>100</td>
                    <td>2000</td>
                  </tr>
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </>
    );
  }
}
gate.getInitialProps = async function() {
  let nextToken = null;
  let results = [];
  let errors;
  let raw = {};
  try {
    do {
      raw = await API.graphql(
        graphqlOperation(queries.listTickets, {
          limit: 10000,
          nextToken: nextToken
        })
      );
      nextToken = raw.data.listTickets.nextToken;
      raw.data.listTickets.items.map(value => results.push(value));
    } while (nextToken);
  } catch (error) {
    errors = error;
  }
  results.map(f => {
    if (!facilities[f.facilityType]) {
      facilities[f.facilityType] = [];
      facilities[f.facilityType].push(f);
    } else {
      facilities[f.facilityType].push(f);
    }
  });

  return { data: raw, errors: errors };
};

export default gate;
